function CompA(props) {
    const changehandler=(event)=>{
        console.log(props)
    }
    const data=props.data;
    return (
        <div className='section-a'>
            {data.map(chair=>(<div className='chair' onClick={changehandler}>
                     <h6>{chair.number}</h6> 
                    </div>))}
        </div>
    )
}

